import { makeStyles, theme } from '@material-ui/core/styles';

export default makeStyles((theme) => ({

    root: {
        "& > *": {
            margin: theme.spacing(1),
            width: theme.spacing(130),
            height: theme.spacing(30)

        }
    },

    customBorderRadius: {
        borderRadius: 25
    }

}));
